create or replace function tcel_obter_dados_item_conv(
	cd_item_p number,
	ie_tipo_item_p varchar2,
	cd_convenio_p number,
	ie_tipo_info_p number
) return varchar2 is

/* 
ie_tipo_info_p
1 - código do item no convênio

*/

ds_retorno_w		varchar2(255) := '';
cd_item_convenio_w	varchar2(20);

begin

	if (ie_tipo_item_p = 'P') then
		select max(cd_proc_convenio)
		into cd_item_convenio_w
		from conversao_proc_convenio
		where cd_procedimento = cd_item_p
		and cd_convenio = cd_convenio_p;
	elsif (ie_tipo_item_p = 'M') then
        select max(cd_material_convenio)
		into cd_item_convenio_w
		from conversao_material_convenio
		where cd_material = cd_item_p
		and cd_convenio = cd_convenio_p;
	end if;

    if (ie_tipo_info_p = 1) then
        ds_retorno_w := cd_item_convenio_w;
    end if;

return	ds_retorno_w;

end tcel_obter_dados_item_conv;
/

create or replace function tcel_obter_estrutura(
    cd_procedimento_p number,
    cd_material_p     number
) return number is

    cd_estrutura_w          conta_estrut_proc.cd_estrutura%type := 0;
    cd_grupo_material_w     estrutura_material_v.cd_grupo_material%type;
    cd_subgrupo_w           estrutura_material_v.cd_subgrupo_material%type;
    cd_classe_material_w    estrutura_material_v.cd_classe_material%type;
    nr_seq_familia_w        estrutura_material_v.nr_seq_familia%type;
    cd_grupo_proc_w         estrutura_procedimento_v.cd_grupo_proc%type;
    cd_especialidade_w      estrutura_procedimento_v.cd_especialidade%type;
    cd_area_proc_w          estrutura_procedimento_v.cd_area_procedimento%type;

begin
    if (nvl(cd_procedimento_p, 0) > 0) then
        -- Busca dados do procedimento
        begin
            select cd_grupo_proc,
                   cd_especialidade,
                   cd_area_procedimento
              into cd_grupo_proc_w,
                   cd_especialidade_w,
                   cd_area_proc_w
              from estrutura_procedimento_v
             where cd_procedimento = cd_procedimento_p;
        exception
            when no_data_found then
                return 0;
        end;

        -- Busca estrutura associada ao procedimento
        select max(cd_estrutura)
		into cd_estrutura_w
		from conta_estrut_proc
		where (cd_grupo_proced is null or cd_grupo_proc_w is null or cd_grupo_proced = cd_grupo_proc_w)
		and (cd_especial_proced is null or cd_especialidade_w is null or cd_especial_proced = cd_especialidade_w)
		and (cd_area_proced is null or cd_area_proc_w is null or cd_area_proced = cd_area_proc_w)
		and (cd_procedimento is null or cd_procedimento_p is null or cd_procedimento = cd_procedimento_p)
		and coalesce(cd_grupo_proced, cd_especial_proced, cd_area_proced, cd_procedimento) is not null;

		cd_estrutura_w := nvl(cd_estrutura_w, 0);

    elsif (nvl(cd_material_p, 0) > 0) then
        -- Busca dados do material
        begin
            select cd_grupo_material,
                   cd_subgrupo_material,
                   cd_classe_material,
                   nr_seq_familia
              into cd_grupo_material_w,
                   cd_subgrupo_w,
                   cd_classe_material_w,
                   nr_seq_familia_w
              from estrutura_material_v
             where cd_material = cd_material_p;
        exception
            when no_data_found then
                return 0;
        end;

        -- Busca estrutura associada ao material
        select max(cd_estrutura)
		into cd_estrutura_w
		from conta_estrut_mat
		where (cd_grupo_material is null or cd_grupo_material_w is null or cd_grupo_material = cd_grupo_material_w)
		and (cd_subgrupo_material is null or cd_subgrupo_w is null or cd_subgrupo_material = cd_subgrupo_w)
		and (cd_classe_material is null or cd_classe_material_w is null or cd_classe_material = cd_classe_material_w)
		and (nr_seq_familia is null or nr_seq_familia_w is null or nr_seq_familia = nr_seq_familia_w)
		and (cd_material is null or cd_material_p is null or cd_material = cd_material_p)
		and coalesce(cd_grupo_material, cd_subgrupo_material, cd_classe_material, nr_seq_familia, cd_material) is not null;

		cd_estrutura_w := nvl(cd_estrutura_w, 0);
    end if;

    return cd_estrutura_w;

exception
    when others then
        return 0;
end tcel_obter_estrutura;
/

create or replace function tcel_obter_ie_atend_ambulatorial(
	nr_interno_conta_p number
) return varchar2 is

ds_retorno_w		varchar2(1) := 'N';
ie_tipo_atend_w	number(3);

begin
    begin
	    select ie_tipo_atend_conta
        into ie_tipo_atend_w
        from conta_paciente 
        where nr_interno_conta = nr_interno_conta_p;


        if (ie_tipo_atend_w = 8) then
            ds_retorno_w := 'S';
        end if;
    exception
        when no_data_found then
            ds_retorno_w := 'N';
        when others then
            ds_retorno_w := 'N'; -- opcional, evita falha inesperada
    end;

return	ds_retorno_w;

end tcel_obter_ie_atend_ambulatorial;
/
